module b2p_2lane_ipgen_lscc_activevideo #(parameter NUM_RX_LANE = 1, 
        parameter RX_GEAR = 8) (
    //==============================================================================
    // PORT DECLARATIONS
    //==============================================================================
    input wire reset_byte_n_i, 
    input wire clk_byte_i, 
    input wire reset_pixel_n_i, 
    input wire clk_pixel_i, 
    input wire [15:0] wc_i,  // payload byte count
    input wire [15:0] wc2_i,  // payload byte count #2
    input wire lp_av_en_i,  // Long Packet of Active Video Enable
    input wire lp2_av_en_i,  // Long Packet of Active Video Enable #2
    input wire read_bgn_c, 
    input wire [1:0] wr_phase_r, 
    input wire [1:0] rd_phase1_r, 
    output reg [15:0] wc_rd_a_r, 
    output reg [15:0] wc_rd_b_r, 
    output reg [15:0] wc_rd_c_r, 
    output reg [15:0] wc_rd_d_r) ;
    reg [15:0] wc_a_r, 
        wc_b_r, 
        wc_c_r, 
        wc_d_r ; // catch WC only for active video packet
    generate
        if (((NUM_RX_LANE * RX_GEAR) == 64)) 
            begin : wc_a_r_64bit
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_a_r <=  0 ;
                        else
                            if (((wr_phase_r == 2'd0) & lp2_av_en_i)) 
                                wc_a_r <=  wc2_i ;
                            else
                                if (((wr_phase_r == 2'd0) & lp_av_en_i)) 
                                    wc_a_r <=  wc_i ;
                    end
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_b_r <=  0 ;
                        else
                            if (((wr_phase_r == 2'd1) & lp2_av_en_i)) 
                                wc_b_r <=  wc2_i ;
                            else
                                if (((wr_phase_r == 2'd1) & lp_av_en_i)) 
                                    wc_b_r <=  wc_i ;
                    end
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_c_r <=  0 ;
                        else
                            if (((wr_phase_r == 2'd2) & lp2_av_en_i)) 
                                wc_c_r <=  wc2_i ;
                            else
                                if (((wr_phase_r == 2'd2) & lp_av_en_i)) 
                                    wc_c_r <=  wc_i ;
                    end
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_d_r <=  0 ;
                        else
                            if (((wr_phase_r == 2'd3) & lp2_av_en_i)) 
                                wc_d_r <=  wc2_i ;
                            else
                                if (((wr_phase_r == 2'd3) & lp_av_en_i)) 
                                    wc_d_r <=  wc_i ;
                    end
            end
        else
            begin : wc_a_r_non64
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_a_r <=  0 ;
                        else
                            if (((~wr_phase_r[0]) & lp_av_en_i)) 
                                wc_a_r <=  wc_i ;
                    end
                always
                    @(posedge clk_byte_i or 
                        negedge reset_byte_n_i)
                    begin
                        if ((~reset_byte_n_i)) 
                            wc_b_r <=  0 ;
                        else
                            if ((wr_phase_r[0] & lp_av_en_i)) 
                                wc_b_r <=  wc_i ;
                    end
            end
    endgenerate
    generate
        if (((NUM_RX_LANE * RX_GEAR) == 64)) 
            begin : genblk2
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                            wc_rd_a_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r == 2'd0))) 
                                // rising
                                wc_rd_a_r <=  wc_a_r ;
                    end
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                            wc_rd_b_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r == 2'd1))) 
                                // rising
                                wc_rd_b_r <=  wc_b_r ;
                    end
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                            wc_rd_c_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r == 2'd2))) 
                                // rising
                                wc_rd_c_r <=  wc_c_r ;
                    end
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                            wc_rd_d_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r == 2'd3))) 
                                // rising
                                wc_rd_d_r <=  wc_d_r ;
                    end
            end
        else
            begin : genblk2
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                            wc_rd_a_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r[0] == 1'd0))) 
                                // rising
                                wc_rd_a_r <=  wc_a_r ;
                    end
                always
                    @(posedge clk_pixel_i or 
                        negedge reset_pixel_n_i)
                    begin
                        if ((~reset_pixel_n_i)) 
                        //          else
                        //              wc_rd_b_r <= wc_rd_b_r;
                            wc_rd_b_r <=  0 ;
                        else
                            if ((read_bgn_c & (rd_phase1_r[0] == 1'd1))) 
                                // rising
                                wc_rd_b_r <=  wc_b_r ;
                    end
            end
    endgenerate
endmodule



